column227:
 'description': 'The civic tech platforms grow quickly but they do not have collective representation. ACTE aims to be the sector’s privileged interlocutor of public authorities and stakeholders of the sector at the European level. Our common objectives are :

● Structure and represent the sector within the European Union;
● Guarantee the original vocation of civic tech by focusing on their democratic purpose;
● Respect the differences in culture and approach of each individual;
● Strengthen and multiply civic tech platforms in all Member States;
● Foster the acculturation of civic tech in order to create new links between public decision-makers and citizens and strengthen the participatory dimension of our European democracies.'

column216:
 'description': ""Accompagner le développement d'un projet de chocolaterie artisanale financée par le gouvernement fédéral mexicain au sein d'une communauté indigène au Chiapas.
- Prospection de nouveaux marchés ; 
- Elargissement de la gamme de produit ; 
- Création matériel promotionnel ; 
- Mise en place d’un système de comptabilité informatique ; 
- Formation des 15 membres de la coopérative aux concepts de gestion.""}

